// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;

contract VotingCommon {

    address owner;
    address admin;
    address manager;

    constructor(address _admin, address _manager){
        owner = msg.sender;
        admin = _admin;
        manager = _manager;
    }

    modifier onlyOwner {
        require(msg.sender == owner, "Only owner can perform this action");
        _;
    }

    modifier onlyAdmin {
        require(msg.sender == owner || msg.sender == admin, "Only owner and admin can perform this action");
        _;
    }

    modifier onlyManager {
        require(msg.sender == manager, "Only manager can perform this action");
        _;
    }

    function setOwner(address _owner) onlyOwner public {
        require(msg.sender != address(0), "Owner not set the first address");
        owner = _owner;
    }

    function setAdmin(address _admin) onlyOwner public {
        admin = _admin;
    }

    function setManager(address _manager) onlyAdmin public {
        manager = _manager;
    }

    function getOwner() public view returns(address){
        return owner;
    }

    function getAdmin() public view returns(address){
        return admin;
    }

    function getManager() public view returns(address){
        return manager;
    }

}
